/* 
Script info: 
Inserts 100 rides into ride table.

Attribute info: 
highest_bid is randomly generated from 0.00 to 30.00.
driver is a sequentially assigned username from all drivers in systemuser.
passenger is a sequentially assigned username from all passengers in systemuser.
from_address and to_address are randomly generated. 
start_time is randomly selected from 01 October 2017 to 19 October 2017. 
end_time is calculated by adding a random number of minutes from 10 to 90, to start time.
Both start_time and end_time are in the default TIMESTAMP format of YYYY-MM-DD HH:MM:SS.
*/

